import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";
import headerLogo from './assets/Hearts_2.png';
import "./index.css";

function Navbar() {
  return (
    <div class="nav">
      <span>
      <div class="left">
        <Link to="/"><img src={headerLogo} width="75" height="75"></img></Link>
        <h6>Hearts of Love</h6>
      </div>
      <div class="right">
        <Link to="/" class="right">Home</Link>
        <Link to="/about" class="right">About</Link>
        <Link to="/join" class="right">Join Us!</Link>
        <Link to="/resources" class="right">Resources</Link>
        <Link to="/shop" class="right">Shop</Link>
        <Link class="right">Contact Us</Link>
        </div>
      </span>
    </div>
  );
}

export default Navbar;
